window.bookSummaryJSON = "<p><b>You can get two times, 10 times, or 100 times more leads than you currently are without</b><b><i> </i></b><b>changing anything about what you sell....</b></p> <p>This book contains the playbooks that took me from sleeping on my gym floor to owning a portfolio of companies that generate $200 million per year in less than a decade. Want to know the biggest difference between those two time periods? How many <i>leads</i> I was getting.</p> <p>The problem is—most business owners don’t know how to get leads.</p> <p><b>I wrote this book to solve your </b><b><i>leads </i></b><b>problem.</b></p> <p>Today, our companies generate 20,000+ new leads per day across 16 different industries. And they do it using the eight “never-go-hungry” playbooks inside. Once you see them, you can’t unsee them. They’re so powerful, they work without your permission.</p> <p>Inside you will find:</p> <ul> <li>The easiest way to get another five customers tomorrow</li> <li>The hook-retain-reward system to transforms content into leads</li> <li>The six-part ad framework that gets more people—especially strangers—to want what you sell</li> <li>The one question that immediately turns any stranger (no matter how cold) into a hot lead</li> <li>The seven direct referral methods responsible for 30 percent of my sales</li> <li>The affiliate playbook that gets hundreds of other businesses to advertise your stuff for free</li> <li>The agency agreement that gets them to teach you their lead-getting secrets at no cost</li> <li>The how-to-get-people-off-the-streets-and-getting-you-leads-in-less-than-two-weeks framework</li> <li>And everything else that got our companies boatloads of leads...fast</li> </ul> <p>And the best part is...you can use these playbooks to get more leads <i>within an hour </i>of listening to this book. You just have to know where to look...and the first place is inside.</p> <p><b>If you want to get more leads for your business...then buy now, use its contents, and see for yourself.</b></p>"; 
